import React from 'react';
import {
    StyledMovieThumb
} from '../styles/StyledMovieThumb';
import {Link} from '@reach/router';


const VideoThumb = ({
    image,
    movieId,
    clickable
}) => ( < StyledMovieThumb > {
        clickable ? ( 
            <Link to={`/${movieId}`}>

<img className = "clickable"
            src = { image}
            alt = "moviethumb" />
            </Link>
        ) : ( <
            img src = {
                image
            }
            alt = "moviethumb" / >
        )
    }

    </StyledMovieThumb>


);

// Exporting the element so you can import it in other places
export default VideoThumb;
